$(document).ready(function(){var e=$("#datetimer").text(),t=Date.now(),r=(t-e)/1e3;console.log("timeDifference",r),setInterval(function(){Date.now();$("#datetimer").text(t)},1e3);var n=$('div[id*="prod-res"]'),o=$('div[id*="stor-res"]');setInterval(function(){for(var e=0;e<o.length;e++){var t=+$(o[e]).text();t+=+$(n[e]).text(),$(o[e]).text(t)}},1e3)});